import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
    return (
        <header className="header">
            <Link to="/" className="header-logo">
                <span className="header-logo-car">Car</span>
                <span className="header-logo-park">Park</span>
            </Link>
            <nav className="header-nav">
                <Link to="/booking" className="header-nav-button">Book Now</Link>
                <Link to="/profile" className="header-nav-link">Profile</Link>
                <Link to="/login" className="header-nav-link">Login</Link>
                <Link to="/signup" className="header-nav-link">Signup</Link>
            </nav>
        </header>
    );
}

export default Header;
